CREATE DEFINER=`synesthesia`@`%` PROCEDURE `insert_opinion`(in v_user_id int, in v_tag varchar(200), in v_lat float, 
in v_long float, in v_op_red int, in v_op_green int, in v_op_blue int)
BEGIN
Declare v_tag_id int;
-- First create the tag if required
select f_tag_id into v_tag_id from t_tag where f_tag = v_tag;
if v_tag_id is null then
	insert into t_tag (f_time, f_user_id, f_tag, f_status) values (sysdate(), v_user_id, v_tag, 'Active');
	set v_tag_id = last_insert_id();
end if;
-- insert the opinion (color) along with goecodes
insert into t_opinion (f_tag_id, f_time, f_user_id, f_long, f_lat, f_op_red, f_op_green, f_op_blue)
value (v_tag_id, sysdate(), v_user_id, v_long, v_lat, v_op_red, v_op_green, v_op_blue);
-- increment the opinion counter in the tag for popularity.
update t_tag set f_count = f_count + 1 where f_tag_id = v_tag_id;
END ;;
